INSERT INTO `products` VALUES (26,'Samsung Galaxy S20+','Mobitel je DUAL SIM otključan za sve mreže. Dostupne boje: bijela.Dostava u sve dijelove BIH, plaćanje po preuzimanju posiljke 8KM. Cijena je fixna. Samo prodaja, zamjene za ovaj artikal ne bih uzimao.',1200,'NEW','Banja Luka, Patre 22','066/123-456','2023-03-03',1,1,0,1,2,56),(27,'iPhone 14','Telefon u odlicnom stanju',2500,'NEW','Banja Luka, Boska','066/562-092','2023-03-04',1,0,0,1,NULL,57),(28,'Samsung S23 Ultra','Samsung Galaxy S23 Ultra - u odlicnom stanju. Mobitel je nov!!!Nema parnica, i bili sta slicno. Sve 100% ispravno. Uz mobitel dolazi punjac,USB kabal, kutija..Saljem brzom postom. Moguc pregled prije kupovine. Bez zamjena! ',2500,'NEW','Gradiska','066/974-234','2023-03-05',1,1,0,1,2,56),(29,'Audi A4','Hitna prodaja',25000,'SECOND_HAND','Bihac','065/234-098','2023-04-03',1,1,1,1,3,44),(30,'Zemljiste','Na samo 5km od Banje Luke, nalazi se ovaj divan plac, sa koga se pruza prelijep pogled na grad.',40000,'SECOND_HAND','Banja Luka','064/235-344','2023-04-09',1,1,0,3,1,86),(31,'Dvosoban stan','Funkcionalan dvosoban stan od 62m2 sa balkonom, na drugom spratu manje stambene zgrade.Stan se sastoji od ulaznog hodnika, kupatila sa toaletom, trpezarije povezane sa kuhinjom, dnevnog boravka, jedne spavace sobe, manje ostave.Posljednja adaptacija stana je radjena 2013 godine i tom prilikom, postavljena je PVC stolarija, a na podovima je postavljen laminat.Stan se prodaje namjesten, sa svim pripadajucim kucanskim aparatima.',189000,'SECOND_HAND','Olovksa/Hrasno','064/343-345','2023-04-09',1,1,0,2,34,59),(32,'Laptop Asus ROG Strix G15 sa RTX 2070 CAD Gaming','Nov laptop u ponudi. Namijenjen za gaming',2380,'SECOND_HAND','Sarajevo - Novi Grad','064/953-105','2023-04-09',1,0,0,1,NULL,51),(33,'AKCIJA- GAMING RACUNAR','Akcijska cijena',2380,'SECOND_HAND','Zenica','062/196-374','2023-04-09',1,0,0,34,NULL,52),(41,'Novi proizvod','Opis novog proizvoda',24000,'SECOND_HAND','Banja Luka','066/234-234','2023-04-22',0,0,0,34,NULL,55);
